    true,nt"url": null,nt"notes": "<p>Service Utilization of Veterans Dually
    Eligible for VA and Medicare Fee-For-Service, 1999-2004<br />nAccording to findings
    in Service Utilization of Veterans Dually Eligible for VA and Medicare Fee For Service
    1999 to 2004, published in Medicare and Medicaid Research Review, volume 2, issue
    3, which comprised a retrospective analysis of VA and Medicare FFS enrollment and
    outpatient utilization databases in 1999 and 2004, newly eligible veterans in high
    VA priority groups, as well as those with the highest HCC risk scores, had decreasing
    odds of exclusive VA reliance, as well as decreasing odds of exclusive Medicare
    reliance, indicating increasing odds of dual system use. Providers should ensure
    coordination of care for Veterans who may be receiving care from multiple sources.</p>n",nt"license_title":
